{
//Complainant same as Originator - send only 1 email otherwise send emails to both of them
	if(current.individual_email.trim() == current.orgntr_email.trim()){
		if(current.individual_email != null) 
			gs.eventQueue("x_grs_compliance.INT_ToCmplnt_Case_New", current);
	}
	else {
		if(current.individual_email != null)
			gs.eventQueue("x_grs_compliance.INT_ToCmplnt_Case_New", current);		
		if(current.orgntr_email != null) {
//		gs.eventQueue("x_grs_compliance.INT_ToOrgntr_Case_New", current);					
		}

	}
}
//For AIR form	
else {
		if(current.individual_email != null)
			gs.eventQueue("x_grs_compliance.AIR_ToCmplnt_Case_New", current);		
}

})();

